CREATE TABLE IF NOT EXISTS `PREFIX_leoslideshow_groups` ( `id_leoslideshow_groups` int(10) unsigned NOT NULL AUTO_INCREMENT, `title` varchar(255) NOT NULL, `id_shop` int(10) unsigned NOT NULL, `hook` varchar(64) DEFAULT NULL, `active` tinyint(1) unsigned NOT NULL DEFAULT '1', `params` text NOT NULL, `active_ap` tinyint(1) DEFAULT NULL, `randkey` varchar(255) DEFAULT NULL, PRIMARY KEY (`id_leoslideshow_groups`,`id_shop`) ) ENGINE=ENGINE_TYPE AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;
CREATE TABLE IF NOT EXISTS `PREFIX_leoslideshow_slides` ( `id_leoslideshow_slides` int(10) unsigned NOT NULL AUTO_INCREMENT, `id_group` int(11) NOT NULL, `position` int(10) unsigned NOT NULL DEFAULT '0', `active` tinyint(1) unsigned NOT NULL DEFAULT '1', `params` text NOT NULL, PRIMARY KEY (`id_leoslideshow_slides`) ) ENGINE=ENGINE_TYPE AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;
CREATE TABLE IF NOT EXISTS `PREFIX_leoslideshow_slides_lang` ( `id_leoslideshow_slides` int(10) unsigned NOT NULL, `id_lang` int(10) unsigned NOT NULL, `title` varchar(255) NOT NULL, `link` varchar(255) NOT NULL, `image` varchar(255) NOT NULL, `thumbnail` varchar(255) NOT NULL, `video` text, `layersparams` text, PRIMARY KEY (`id_leoslideshow_slides`,`id_lang`) ) ENGINE=ENGINE_TYPE DEFAULT CHARSET=utf8;
